import styled from "styled-components";

const HeaderContainer = styled.div`
  background: #142610;
  height: 20 rem;

  h1 {
    text-align: center;
    color: #fafaee;
    margin: 0px;
    padding: 7rem;
  }
`;

const Header = () => {
  return (
    <HeaderContainer>
      <h1>My favorite veggies</h1>
    </HeaderContainer>
  );
};

export default Header;
